import React, { Component } from 'react';
import pageOne from './images/pg1.jpg';
import pageTwo from './images/pg2.jpg';

class SmallCardPanel extends Component {
	static defaultProps = {
		cards: [
			{
				name: 'Card1',
				src: pageOne
			},
			{
				name: 'Card2',
				src: pageTwo
			}
		]
	};
	render () {
		return (
			<div>
				<img src={this.props.cards.src} />
			</div>
		);
	}
}

export default SmallCardPanel;
